class Solution(object):
    def firstMissingPositive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # 1. mark all negative numbers as 0
        # 2. mark all numbers in the range [1, len(nums)] as 1
        # 3. iterate through the array and mark the number at nums[i] as -1
        # 4. iterate through the array again and return the first number that is not marked as -1

        n = len(nums)
        for i in range(n):
            if nums[i] <= 0:
                nums[i] = n + 1

        for i in range(n):
