        """
        :type s: str
        :rtype: int
        """

        # 1. create a hashmap to store the frequency of each character
        # 2. iterate through the hashmap and add the max(odd, 1) to the result
        # 3. return result

        hashmap = {}
        for char in s:
            if char not in hashmap:
                hashmap[char] = 1
            else:
                hashmap[char] += 1

        result = 0
