class Solution(object):
    def removeInvalidParentheses(self, s):
        """
        :type s: str
        :rtype: List[str]
        """

        def isValid(s):
            cnt = 0
            for c in s:
                if c == '(':
                    cnt += 1
                elif c == ')':
                    if cnt > 0:
                        cnt -= 1
                    else:
                        return False
            return cnt == 0

        q = collections.deque([s])
        seen = {s}
        while q:
            s = q.popleft()
            if isValid(s):
                return [s]
            for i in range(len(s)):
                if s[i] not in '()':
                    continue
                t = s[:i] + s[i+1:]
                if t not in seen:
                    q.append(t)
                    seen.add(t)
        return list(seen)

